INSERT INTO `recipes` VALUES (1,'Scones',NULL,NULL,NULL),(4,'Blåmusslor','Gör så här \n1. Tvätta musslorna väl. Släng alla som är trasiga och som inte sluter sig när man knackar på dem. Släng även de musslor som är väldigt tunga, de är antagligen fulla med lera. \n2. Skala schalottenlöken och skär ner den. Skär även ner fänkålen. \n3. Sätt en kastrull på spisen med lite olja i botten. Låt den bli het och slå i musslor, lök och kryddor.\n4. Slå vinet över och låt det hela koka upp. Dra kastrullen från spisen och låt musslorna stå och dra i cirka 20 minuter. Alla musslor ska då ha öppnat sig, släng de som fortfarande är slutna. \n5. Sila fonden genom en finmaskig sil och spara den. Servera musslorna med lite färska örter.','','PNG\r\n\Z\n\0\0\0\rIHDR\0\0\0\\0\0\0\\0\0\0o4\0\0\0tEXtSoftware\0Adobe ImageReadyq\e<\0\0BoIDATx\\}	|SUMt\w\F\Rldt\@qFq\GD6os\}WD\q\\\0ADlERhK\r\}M97/i&m\&\;|\%}\\{\\9\s	DI$DIE\\h4W^y%\qRKE\?ټyLdV2,a	\ɺ\\*0EeV9dlD\BVRyJ`\/,kB*	8\z$B\ZZr\)-\(\TR*\\\ؽ\\#L\\\PI0d\\{5L&0\]fLPmooc~$0yk\\\\\ի\\\ Í;\Jҏ}+WnhkkAC$0T*Ufppp\͔ܜB\\\\\U-\e7\>ӓ\$	Gs\WQ\M@}\Zj\\!Մ`\\f3U\0=z/I$0\Ѝ7\`ԇ>%rX\'&Va͚5Ec`TJV[C,\\#mAѧh\\oFG.?cH].!\\\X\"%1и\\O\Z\Yfe2v\ͥ~w\̙#ڟ\~zK6r\\)w\"wmTd\\?\eOOO?W\\ׯO\\Aã>J\\\iТO;w\?\o/U\@c\V]d+3@$[Gy$ߘ\^{\,A/R(\\\s\C)c\.]\r\r\\S9\0!|VZ#l1\\>΄c\\naUن\rV\wt}s90§?00\;\\&\\r)	=\\p\\[n	tK/t1f\r\/	nnnO\r,\\\#E@ tvv*\x㍽\]hA\0Vќ\_DDD\n\\0a\0J:\\^^^+\\\\'FEE\WYĨE\\\o+s\\rL$\R\7n|\\Z.\oЪT\;v\\]w\|FVMR3iҤ_a\|||\\\E2@-0`x\[\\\\6@p |\\֖\onc\rT\'\4\nWTKJJ29bb\\"a1\\n-\ŋ\`\\:p u(\\Z\"N6-\ÞHNi֮]\\\\믿^\\=\?lڴ\Dkkk[o@\2\\"4\\[{ X|Y@pe?\Z\Zz\e˦\"O2Q8\\0~o3tj\Ji\0ᙶ>|)b\\Z `\4((hSSӖ\~KEp\n *(U0d\n=+V\\\\ȩ\	*\\<0\\\\0\'\{R%u\\\𧂂9\!򽬶*`\q\\E\8q͙n\d)h^ڡBy;\6\\\y\Z\\ȢE\0`]ϓ#Oz\j7\\9\\@\?|<VBk\\\\otY\V,\j\0uuu\?\oص\Z\\\rI\0xf\\Z\rt`ќ9sB+^q\\2Xh\\xP2\0|